import React, { ReactNode } from "react";
import { Grid, Box, Button, Typography } from "@mui/material";
import { Link } from "react-router-dom";

export default function DisplaySection(props: {
  left: boolean;
  back: string;
  display: string;
  title: string;
  subtitle: string;
  desc: string;
  buttonLink: string;
}) {
  return (
    <div>
      <Box sx={{ flexGrow: 1 }} className="parallax">
        <img className="back" src={props.back} alt="" />
        <div className="overlay" />
        <Grid
          container
          className="top"
          spacing={3}
          alignContent="center"
          alignItems="center"
        >
          {props.left ? (
            <>
              <Grid item sm={12} md={6}>
                <img
                  className="display-img"
                  src={props.back}
                  alt="Display Image"
                />
              </Grid>
              <Grid item sm={12} md={6}>
                <div className="c-content">XS Something</div>
              </Grid>
            </>
          ) : (
            <>
              <Grid item sm={12} md={6}>
                <Typography variant="h2" component="h2">
                  {props.title}
                </Typography>
                <br />
                <br />
                <Typography variant="body2" component="span">
                  {props.subtitle}
                </Typography>
                <br />
                <br />
                <Typography variant="body2" component="span">
                  {props.desc}
                </Typography>
                <br />
                <br />
                <br />
                <Link to={props.buttonLink} style={{ textDecoration: "none" }}>
                  <Button className="btn" variant="contained" size="small">
                    {props.title}
                  </Button>
                </Link>
              </Grid>
              <Grid item sm={12} md={6}>
                <img
                  className="display-img"
                  src={props.display}
                  alt="Display Image"
                />
              </Grid>
            </>
          )}
        </Grid>
      </Box>
    </div>
  );
}
